@O mito da caverna Obrigado pela ofensa, mas o meu questionamento é a respeito da responsabilidade dessa afirmação também. Segundo a lógica da reportagem CoVid19 será menos letal pois o vírus tende a querer sobreviver. 
Contudo, eu devolvo com outra pergunta:
Pra fazer essa afirmação, inclusive no título foi embasado em quê? Qual é a evidência científica? Pois ainda não deu tempo de ter essa resposta.

